описание:
Разноцветные кометы раскрываются сферами из:
1. красных огней с форсами;
2. зеленых огней с форсами.

Разноцветные кометы раскрываются сферами из:
1. красных огней с форсами;
2. зеленых огней с форсами.

Разноцветные кометы раскрываются сферами из:
1. красных огней с форсами;
2. зеленых огней с форсами.

5 эффектов. Трещащие искристые трассы разрываются сферами из: 

крупных красных огней и трещащих искристых форсов;
крупных зеленых огней и трещащих искристых форсов;
крупных желтых огней и трещащих искристых форсов;
синих огней и трещащих искристых форсов;
крупных фиолетовых огней и трещащих искристых форсов.

Красочная концовка из нескольких залпов.

Разноцветные кометы разрываются сферами из:
1. красных огней и множества трещащих сфер;
2. зеленых огней и множества трещащих сфер;
3. синих огней и множества трещащих сфер.

7 эффектов. 
Разноцветные кометы; золотые искристые трассы разрываются сферами из: 
1. красных и белых мерцающих огней; 
2. разноцветных огней с трещащими искристыми форсами; 
3. золотых форсов с серебряными искрами и синими букетиками в центре; 
4. красных огней с серебряными разлетающимися огоньками и синими букетиками в центре; 
5. красных огней с трещащими искристыми форсами; 
6. зеленых мерцающих огней с синими и красными букетиками в центре; 
7. трещащих огней (залп).

7 эффектов. Разноцветные кометы, серебряные трассы разрываются сферами из: 
1. красных и золотых огней с переходом в зеленые огни;
2. трещащих швермеров;
3. синих и красных огней с золотыми искристыми шуршащими форсами;
4. серебряных искристых шуршащих форсов;
5. белых искристых форсов;
6. разноцветных огней с золотыми искристыми шуршащими форсами;
7. множества трещащих сфер (залпы).
